import NFLPlayer from './NFLPlayer'

const NFLPlayers = ({ nflPlayers }) => {
  return (
    <>
      <h1>NFL Player Statistics</h1>
      <table>
        <tbody>
          <th>
            {

            }
          </th>
          {nflPlayers.map((nflPlayer, index) => (
            <NFLPlayer key={index} nflPlayer={nflPlayer} />
          ))}
        </tbody>
      </table>
    </>
  )
}

export default NFLPlayers
